export const type = {
  SEND_DATA: 'SEND_DATA',
  RECEIVE_DATA: 'RECEIVE_DATA'
};

export function sendStudentData(studentData) {
  return{
    type: type.SEND_DATA,
    studentData,
  }
}

export function receiveData(studentData){
  return {
    type: type.RECEIVE_DATA,

  }
}
